	return (
		<form>
			<label htmlFor='username'>Username</label>
			<input type='text' id='age' />
			<label htmlFor='age'>Age</label>
			<input type='password' id='age' />
			<button type='submit' onClick={handleSubmit}>Add user</button>
		</form>
	);
};

export default AddUser;
